import React from "react";
import Aux from "./Auxliliary/Auxiliary";
import "./App.css";

const Emoji = (props) => {
let {x,y, z} = props;
if (x ===y & y === z)
  return (
    <Aux>
    <div className = "div4">
            <span>{props.emoji}</span>
            <p>{x}, {y}, {z}</p>
    </div>
            
    </Aux>
  );
};

export default Emoji;
